import React, { useState } from 'react';
import axios from 'axios';

const App1 = () => {

    const [name, setName] = useState("");

    const fetchData = async() => {
        const result = await fetch('https://api.github.com/users/thenanosoft');
        const colectData = await result.json();
        console.log(colectData);
        setName(colectData);
    }


  return (
    <div>
      <div>
          <h1>Login: {name.login}</h1>
          <h2>User Id: </h2>
          <button onClick={fetchData}>Add</button>
      </div>
    </div>
  )
}

export default App1
